script: |
  super -f text -I q12438.spq | sort > q12438.out

inputs:
  - name: q12438.spq
    data: |
      SELECT 95 + + col1 * - col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT col2 BETWEEN ( + - ( + - col2 ) - - 25 * - + col1 ) AND - 10;
  - name: tab1

outputs:
  - name: q12438.out
    data: |
      -1249
      -200
      -3101
